DROP TABLE IF EXISTS aircraft;
CREATE TABLE aircraft (
  aircraft_id serial,
  icao varchar(10) NOT NULL,
  type varchar(255) NOT NULL,
  manufacturer varchar(255) NOT NULL,
  official_page varchar(255) NOT NULL,
  aircraft_shadow varchar(255) DEFAULT NULL,
  aircraft_description varchar(255) DEFAULT NULL,
  engine_type varchar(255) DEFAULT NULL,
  engine_count integer DEFAULT NULL,
  wake_category varchar(10) DEFAULT NULL,
  mfr varchar(255) DEFAULT NULL
);


ALTER TABLE aircraft ADD PRIMARY KEY (aircraft_id), ADD UNIQUE (icao);